import React from 'react';
import classNames from 'classnames';
import styles from './ImageBanner.module.scss';

const { container, image, skydive, kayak, studlagil, hourse } = styles;
interface IImageBanner {
  images: string[];
}

const ImageBanner = () => {
  return (
    <div className={container}>
      <div className={classNames(image, skydive)} />
      <div className={classNames(image, kayak)} />
      <div className={classNames(image, studlagil)} />
      <div className={classNames(image, hourse)} />
    </div>
  );
};

export default ImageBanner;
